import React from "react";

const Footer = () => {

    return (
        <footer>
            <div>
                <div className="social">
                    <i class="fab fa-twitter"></i>
                    <i class="fab fa-instagram"></i>
                </div>
                <div className="copyright">
                    Copyright &copy, 2022.
                </div>
            </div>
        </footer>

    );
}

export default Footer;
